import React, { FunctionComponent } from "react";
import Skin from "../../models/skin";
import { useHistory } from "react-router-dom";

import "./style.css"

type Props = {
    skin: Skin
};

const SkinCard: FunctionComponent<Props> = ({ skin }) => {

    const goToSkin = (id: number) => {
        history.push(`/skins/${id}`);
    }


    return (
        <li className='card_skin flex-row flex-center-y p15 relative' onClick={() => goToSkin(skin.id)}>
            <div className='flex-col'>
                <img src={skin.picture}></img>
            </div>
        </li>
    );
}

export default SkinCard;
